import React, {Component} from 'react';
import './Background.css';

class Background extends Component{
    render(){
        return (
            <div className="background-svg">
                <svg>
                    <path d="M0 0 L150 150 L350 150" fill="transparent" stroke="#333"></path>
                    <circle cx="354" cy="150" r="4" fill="transparent" stroke="#333"></circle>
                    <path d="M160 150 L160 280" fill="transparent" stroke="#333"></path>
                    <circle cx="160" cy="284" r="4" fill="transparent" stroke="#333"></circle>
                    <path d="M40 40 L40 60 L145 165 L145 300" fill="transparent" stroke="#333"></path>
                    <circle cx="145" cy="304" r="4" fill="transparent" stroke="#333"></circle>
                    <path d="M145 270 L130 290 L130 335" fill="transparent" stroke="#333"></path>
                    <circle cx="130" cy="339" r="4" fill="transparent" stroke="#333"></circle>

                    <circle cx="20" cy="60" r="4" fill="transparent" stroke="#333"></circle>
                    <path d="M20 64 L20 560 L0 580" fill="transparent" stroke="#333"></path>
                    <path d="M20 120 L40 00" fill="transparent" stroke="#333"></path>

                    <path d="M20 0 L155 135 M55 35 L100 35 M155 135 L370 135" fill="transparent" stroke="#333"></path>
                    <circle cx="374" cy="135" r="4" fill="transparent" stroke="#333"></circle>
                    <circle cx="104" cy="35" r="4" fill="transparent" stroke="#333"></circle>
                    
                    <path d="M40 0 L60 20 L80 20" fill="transparent" stroke="#333"></path>
                    <circle cx="84" cy="20" r="4" fill="transparent" stroke="#333"></circle>
                    
                    <circle cx="100" cy="60" r="4" fill="transparent" stroke="#333"></circle>
                    <path d="M103 63  L160 120 L1000 120" fill="transparent" stroke="#333"></path>
                    <circle cx="1004" cy="120" r="4" fill="transparent" stroke="#333"></circle>


                </svg>
            </div>
        );
    }
}

export default Background;
